from PySide6.QtCore import QByteArray
from PySide6.QtGui import QIcon, QPixmap

class GRes:
	app_ico = b''
	app_icon_ico = b''
	help_svg = b''
	icon_ico = b''
	icon_svg = b''
	notes_svg = b''


def GMakeIcon(base64):
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64))
    icon = QIcon(pixmap)
    return icon